import React from "react";
import logoImage from "./assets/logo_image.jpg";

function Header() {
  return (
    <div className="container">
      <div className="logo-banner">
        <div className="logo_img">
          <img src={logoImage} alt="Logo" className="logo_image" />
        </div>
        <span className="logo_name">
          Sổ điện tử <br /> Sinh viên
        </span>
      </div>

      <div className="blue-banner flex flex-between">
        <h1>TRƯỜNG ĐẠI HỌC MỸ THUẬT CÔNG NGHIỆP</h1>
        <div className="account-functions">
          <div className="notification"></div>
          <div className="user-account"></div>
        </div>
      </div>
    </div>
  );
}

export default Header;
